def aut_coupling_test(my_sne):
    print("aut_coupling test:")
    #out_file = open("aut_coupling result.txt", "w")

    t_initial = time.perf_counter()
    authors_set = set()
    for row in my_sne.sse.data:
        authors_set.update(row["authors"].split("; "))

    authors_list = list(authors_set)
    authors_list = sorted(authors_list)
    coup = list()
    for i in range(len(authors_list)):
        for j in range(i, len(authors_list)):
            coup.append(my_sne.aut_coupling(authors_list[i], authors_list[j]))

    t_final = time.perf_counter()
    print("   time:   ", t_final - t_initial)

    # with open('aut_coupling result.txt', 'w') as f:
    #     for item in coup:
    #         f.write("%s\n" % item)

    with open('aut_coupling result.txt') as f:
        lines = f.read().splitlines()

    expected = list()
    for item in lines:
        expected.append(int(item))
    f.close()

    print("   accuracy:   ", expected == coup)
    print()
    return coup


